import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import StudentForm from "./StudentForm.js";

function StudentData(){
    const[data,setData]=useState([])
    useEffect(()=>{
        fetch("http://localhost:3008/StudentDatabase")
        .then((res)=>{
            return res.json();
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp)
        })
        
    },[])
    return(
        <div className="Container">
            <div className="Card">
                <div className="Card-title"><h1>Student Database Management System</h1></div>
                <div className="Card-body">
                    <Link to="./StudentForm" className="btn btn-success">ADD new(+)</Link>
                    <table  className="table table-bordered">
                        <thead className="bg-dark text-white"></thead>
                        <tr>
                            <th>Id</th>
                            <th>Name</th>
                            <th>City</th>
                            <th>Roll No</th>
                            <th>Mobile</th>
                            <th>Course</th>
                            <th>DOJ</th>
                        </tr>
                        <tbody>
                            {data.map((item)=>(
                                <tr key={item.id}>
                                    <td>{item.Name}</td>
                                    <td>{item.City}</td>
                                    <td>{item.RollNO}</td>
                                    <td>{item.Mobile}</td>
                                    <td>{item.Course}</td>
                                    <td>{item.DOJ}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
            
        </div>
    )
}
export default StudentData;
